#!/bin/bash

file=fastmult.cpp
MAXTIME="8.0"

if [ ! -f "$file" ]; then
    echo -e "Error: File '$file' not found.\nTest failed."
    exit 1
fi

num_right=0
total=0
line="________________________________________________________________________"
compiler=
interpreter=
language=
extension=${file##*.}
if [ "$extension" = "py" ]; then
    if [ ! -z "$PYTHON_PATH" ]; then
        interpreter=$(which python.exe)
    else
        interpreter=$(which python3.6)
    fi
    command="$interpreter $file"
    echo -e "Testing $file\n"
elif [ "$extension" = "java" ]; then
    language="java"
    command="java ${file%.java}"
    echo -n "Compiling $file..."
    javac $file
    echo -e "done\n"
elif [ "$extension" = "c" ] || [ "$extension" = "cpp" ]; then
    language="c"
    command="./${file%.*}"
    echo -n "Compiling $file..."
    results=$(make 2>&1)
    if [ $? -ne 0 ]; then
        echo -e "\n$results"
        exit 1
    fi
    echo -e "done\n"
fi

run_test_args() {
    (( ++total ))
    echo -n "Running test $total..."
    expected=$2
    local ismac=0
    date --version >/dev/null 2>&1
    if [ $? -ne 0 ]; then
       ismac=1
    fi
    local start=$(date +%s.%N)
    timeout $MAXTIME bash -c "$command $1 2>&1 | tr -d '\r' > tmp.txt"
    local rc=$?
    local end=$(date +%s.%N)

    if [ $rc -eq 124 ]; then
        echo "failure [timed out after $MAXTIME seconds]"
    else
        received=$(cat tmp.txt)
        { $command $1 2>&1 > /dev/null; } 1>/dev/null 2>error.txt
        error=$(cat error.txt)
        if [ ! -z "$error" ]; then
            received="${received}\n$error"
        fi
        local elapsed=$(echo "scale=3; $end - $start" | bc | awk '{printf "%.3f", $0}') 
        if [ "$expected" != "$received" ]; then
            echo -e "failure\n\nExpected$line\n$expected\n"
            echo -e "Received$line\n$received\n"
        else
            echo "success: [$elapsed seconds]"
            (( ++num_right ))
        fi
    fi
    rm -f tmp.txt error.txt
}

set -bm
trap "echo SIGSEGV" SIGSEGV

# zero cases
run_test_args "0 0" "0"
run_test_args "0 9" "0"
run_test_args "0 17" "0"
run_test_args "0 123456789123456789" "0"
run_test_args "123456789123456789 0" "0"

# NxN for N=2,3,...,10
run_test_args "99 66" "6534"
run_test_args "998 939" "937122"
run_test_args "8789 6513" "57242757"
run_test_args "42084 93873" "3950551332"
run_test_args "949442 610700" "579824229400"
run_test_args "9283036 9385537" "87126277850332"
run_test_args "68125535 32601158" "2220971330369530"
run_test_args "221018574 940827094" "207940262696443956"
run_test_args "3604222730 7915268283" "28528389859636672590"

# AxB for A,B at most 30 digits
run_test_args "664785219 2178103948399274413" "1447971310341376340087301447"
run_test_args "4902690489354 318412748629973583" "1561079154397237378710362735382"
run_test_args "3466482866168805760715285 45121204265984" "156411881488936361840653191861234365440"
run_test_args "262452116095 681901868507460" "178966588358917316293568700"
run_test_args "478701558029 801424211983130" "383643018918487902864050770"
run_test_args "8919343381135 904916" "8071256535083159660"
run_test_args "6895966 509756253629791938782" "3515261793318421796914753412"
run_test_args "35738735148687379 7208812357886795567029973" "257633835595100761966256553674660499810767"
run_test_args "9428020 4814080605034718" "45387248225879421998360"
run_test_args "94983873426806 69035639670455695813" "6557272460397150888417137456163278"

# big cases: NxN for N in (100, 500, 1000, 2000, 4000, 10000)
run_test_args "4053650332629917890745984979671732523012098327728408240951331080719022359683506976202834724727509152 9508636220741080028324144861853684368603225878782224203425995653605527438561958987028876948453635861" "38544686379063964414894834388467801491974227130375787867239642370387226549584858445318836777763673413445466074026341702409891339316173220475322945335258609615230363991133340538979060944289700552899872"
run_test_args " " ""
run_test_args " " ""
run_test_args " " ""
run_test_args " " ""
run_test_args " " ""

echo -e "\nTotal tests run: $total"
echo -e "Number correct : $num_right"
echo -n "Percent correct: "
echo "scale=2; 100 * $num_right / $total" | bc

if [ "$language" = "java" ]; then
    echo -e -n "\nRemoving class files..."
    rm -f *.class
    echo "done"
elif [ $language = "c" ]; then
    echo -e -n "\nCleaning project..."
    make clean > /dev/null 2>&1
    echo "done"
fi
